import React from 'react';
import '../styles/chartcard.css';

class ChartCard extends React.Component {

    render() {
        return (
            <div class="card" className="chartcard">
                <div class="card-header">
                    <h4 style="color: rgb(134,136,151);">Mức độ hài lòng</h4>
                </div>
                <div class="card-body">
                    <div><canvas height="408" width="816" style="display: block; height: 204px; width: 408px;"></canvas></div>
                </div>
            </div>
        );
    }
}

export default ChartCard;
